import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";
import Card from "./Card";
import React from "react";
class Expenses extends React.Component {
  render() {
    return (
      <Card className="expenses">
        <ExpenseItem
          title={this.props.item[0].title}
          amount={this.props.item[0].amount}
          date={this.props.item[0].date}
        ></ExpenseItem>
        <ExpenseItem
          title={this.props.item[1].title}
          amount={this.props.item[1].amount}
          date={this.props.item[1].date}
        ></ExpenseItem>
        <ExpenseItem
          title={this.props.item[2].title}
          amount={this.props.item[2].amount}
          date={this.props.item[2].date}
        ></ExpenseItem>
        <ExpenseItem
          title={this.props.item[3].title}
          amount={this.props.item[3].amount}
          date={this.props.item[3].date}
        ></ExpenseItem>
      </Card>
    );
  }
}

export default Expenses;
